import React from 'react'
import './Expenses.css'
import ExpenseItem from './ExpenseItem'
import Card from '../UI/Card';

function Expenses(props) {

    const { expense } = props;
    return (
      <Card className="expenses">
        {expense.map(item => (
          <ExpenseItem
          key={item.id}
          title={item.title}
          date={item.date}
          amount={item.amount}
          />
        ))}
      </Card>
    )
}
